import React from 'react';
import { motion } from 'framer-motion';

export default function AnimeImages() {
    return (
        <>
            {/* Menu */}
            <motion.nav
                style={{
                    display: 'flex',
                    justifyContent: 'space-around',
                    alignItems: 'center',
                    height: '50px',
                    backgroundColor: '#222',
                    color: '#fff',
                    fontSize: '18px',
                    fontWeight: 'bold',
                }}
                initial={{ y: -100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                <div>Home</div>
                <div>Gallery</div>
                <div>Contact</div>
            </motion.nav>

            {/* Section principale */}
            <motion.div
                style={{
                    display: 'flex',
                    justifyContent: 'space-around',
                    alignItems: 'center',
                    height: '80vh',
                    backgroundColor: '#000000',
                }}
            >
                {/* Premier conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <img
                        src="https://images6.alphacoders.com/135/1352218.png" // Image de Luffy
                        alt="Luffy"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                    />
                </motion.div>

                {/* Deuxième conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                        delay: 0.3,
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <img
                        src="https://images2.alphacoders.com/136/1369365.jpeg" // Image de Zoro
                        alt="Zoro"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                    />
                </motion.div>
            </motion.div>

            {/* Footer */}
            <motion.footer
                style={{
                    height: '50px',
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#222',
                    color: '#fff',
                    fontSize: '16px',
                }}
                initial={{ y: 100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                © 2024 Anime Gallery - Tous droits réservés
            </motion.footer>
        </>
    );
}
